import React from 'react';

const Navbar = () => {
  const navbarStyle = {
    position: 'fixed',    // Fixed position to keep it in place
    top: '50%',           // Vertically centered
    right: '0',           // Positioned to the right
    transform: 'translateY(-50%)', // Centered vertically
    backgroundColor: '#333',      // Background color
    color: '#fff',        // Text color
    padding: '10px 20px', // Padding for content
    zIndex: '1000',       // Z-index to make it appear above other elements
  };

  return (
    <nav style={navbarStyle}>
      <div className="navbar-brand">Your Logo</div>
    </nav>
  );
};

export default Navbar;
